def _callFUT(self, iface):
    from zope.interface.document import asStructuredText
    return asStructuredText(iface)

@reify
def renderer(self):
    factory = self.registry.queryUtility(IRendererFactory, name=self.type)
    if factory is None:
        raise ValueError('No such renderer factory %s' % str(self.type))
    return factory(self)
